module bemsa
  implicit none
  integer, parameter :: wp  = kind(1.0D0)
  real(wp)::r(9,9)
  real(wp), parameter :: a = 2.d0 
contains
  function emsav(x,c) result(v)
    implicit none
    real(wp),dimension(1:36)::x
    real(wp),dimension(0:8996)::p
    real(wp),dimension(0:8996)::c
    real(wp)::v
    
    call bemsav(x,p)
    v = dot_product(p,c)
    
    return
  end function emsav

function gemsav(flag,x,m,p,dp,c,xyz) result(g)
    implicit none
    integer :: flag
    real(wp),dimension(1:36)::x
    real(wp),dimension(0:4142)::m
    real(wp),dimension(0:8996)::p
    real(wp),dimension(0:8996)::dp
    real(wp),dimension(0:8996)::c
    real(wp)::xyz(9,3)
    real(wp)::g 
	call EvaldpBasisSet(flag,x,m,p,dp,xyz)
    g = dot_product(dp,c)
    return
  end function gemsav


Subroutine EvaldpBasisSet(flag,x,m,p,dp,xyz)

        implicit none
    real(wp),dimension(1:36)::x
    real(wp),dimension(0:4142)::m
    real(wp),dimension(0:8996)::p
    real(wp),dimension(0:8996)::dp
    real(wp),dimension(0:8996)::c
    real(wp)::xyz(9,3)
    integer::flag

    call dbemsav(dp,m,p,flag,xyz)
      Return

      END Subroutine EvaldpBasisSet


  subroutine bemsav(x,p)
    implicit none
    real(wp),dimension(1:36)::x
    real(wp),dimension(0:4142)::m
    real(wp),dimension(0:8996)::p
    ! ::::::::::::::::::::

    
    call evmono(x,m)
    call evpoly(m,p)
    
    return
  end subroutine bemsav
  
  
